<?php

namespace Publisher\Framework\Illuminate\StyleEngine\StyleDefinitions;

/**
 * The Effect style definition
 *
 * @package Publisher\Framework\Illuminate\StyleEngine\StyleDefinitions\Effects
 */
class Effects extends BaseStyleDefinition {

	/**
	 * @inheritDoc
	 *
	 * @param array $setting
	 *
	 * @return array
	 */
	protected function collectProps( array $setting ): array {

		$cssProperty = $setting['type'];

		switch ( $cssProperty ) {

			case 'transform':
			case 'self-origin':
			case 'child-origin':
			case 'self-perspective':
			case 'child-perspective':
				$this->setTransforms( $setting, $cssProperty );
				break;

			case 'transition':
				array_map( [ $this, 'setTransition' ], array_filter( $setting['transition'], [ $this, 'isVisibleSetting' ] ) );
				break;

			case 'filter':
				array_map( [ $this, 'setFilter' ], array_filter( $setting['filter'], [ $this, 'isVisibleSetting' ] ) );
				break;

			case 'mask':
				array_map( [ $this, 'setMask' ], array_filter( $setting['mask'], [ $this, 'isVisibleSetting' ] ) );
				break;

			case 'backdrop-filter':
				array_map( [ $this, 'setBackdropFilter' ], array_filter( $setting[ $cssProperty ], [ $this, 'isVisibleSetting' ] ) );
				break;

			case 'opacity':
				$this->setProperty( 'opacity', pb_get_value_addon_real_value( $setting[ $cssProperty ] ) );
				break;

			case 'mix-blend-mode':
			default:
				$this->setProperty( $cssProperty, $setting[ $cssProperty ] );
				break;
		}

		return $this->properties;
	}

	/**
	 * Check is visible setting?
	 *
	 * @param array $setting The setting array to check is visible.
	 *
	 * @return bool true on success, false when otherwise.
	 */
	protected function isVisibleSetting( array $setting ): bool {

		return ! empty( $setting['isVisible'] );
	}

	/**
	 * Check is valid setting for style?
	 *
	 * @param array $setting array of style setting.
	 *
	 * @return bool true on success, false on otherwise.
	 */
	protected function isValidSetting( array $setting ): bool {

		return ! empty( $setting[ $setting['type'] ] );
	}

	/**
	 * Retrieve cache key.
	 *
	 * @param string $suffix the cache key suffix.
	 *
	 * @return string
	 */
	protected function getCacheKey( string $suffix = '' ): string {

		return pb_get_classname( __NAMESPACE__, __CLASS__ ) . parent::getCacheKey( $suffix );
	}

	/**
	 * Setup transform style properties into stack properties.
	 *
	 * @param array  $settings    The settings for css property.
	 * @param string $cssProperty The valid css property.
	 *
	 * @return void
	 */
	protected function setTransforms( array $settings, string $cssProperty ): void {

		// add all transform items
		if ( 'transform' === $cssProperty && ! empty( $settings[ $cssProperty ] ) ) {

			array_map( [ $this, 'setTransformItem' ], array_filter( $settings[ $cssProperty ], [ $this, 'isVisibleSetting' ] ) );
		}

		if ( 'self-perspective' === $cssProperty && ! empty( $this->properties['transform'] ) && ! empty( $settings[ $cssProperty ] ) ) {

			$perspective = pb_get_value_addon_real_value( $settings[ $cssProperty ] );

			if ( ! empty( $perspective ) ) {
				$this->setProperty(
					'transform',
					sprintf(
						'perspective(%s) %s',
						$perspective,
						$this->properties['transform']
					)
				);
			}
		}

		if ( 'self-origin' === $cssProperty && ! empty( $settings[ $cssProperty ] ) ) {

			$top  = isset( $settings[ $cssProperty ]['top'] ) ? pb_get_value_addon_real_value( $settings[ $cssProperty ]['top'] ) : '';
			$left = isset( $settings[ $cssProperty ]['left'] ) ? pb_get_value_addon_real_value( $settings[ $cssProperty ]['left'] ) : '';

			if ( ! empty( $top ) && ! empty( $left ) ) {

				$this->setProperty( 'transform-origin', "{$top} {$left}" );
			}
		}

		if ( 'backface-visibility' === $cssProperty && ! empty( $settings[ $cssProperty ] ) ) {

			$this->setProperty( 'backface-visibility', $settings[ $cssProperty ] );
		}

		if ( 'child-perspective' === $cssProperty && ! empty( $settings[ $cssProperty ] ) ) {

			$childPerspective = pb_get_value_addon_real_value( $settings[ $cssProperty ] );

			if ( ! empty( $childPerspective ) ) {
				$this->setProperty(
					'perspective',
					'0px' !== $childPerspective ? $childPerspective : 'none'
				);
			}
		}

		if ( 'child-origin' === $cssProperty && ! empty( $settings[ $cssProperty ] ) ) {

			$top  = $settings[ $cssProperty ]['top'] ?? '';
			$left = $settings[ $cssProperty ]['left'] ?? '';

			if ( ! empty( $top ) && ! empty( $left ) ) {
				$this->setProperty( 'perspective-origin', "{$top} {$left}" );
			}
		}
	}


	/**
	 * Setup transform style properties into stack properties.
	 *
	 * @param array $setting the transform setting.
	 *
	 * @return void
	 */
	protected function setTransformItem( array $setting ): void {

		if ( empty( $setting ) ) {

			return;
		}

		$transform = '';

		switch ( $setting['type'] ) {
			case 'move':
				$transform = sprintf(
					'translate3d(%s, %s, %s)',
					pb_get_value_addon_real_value( $setting['move-x'] ),
					pb_get_value_addon_real_value( $setting['move-y'] ),
					pb_get_value_addon_real_value( $setting['move-z'] ),
				);
				break;

			case 'scale':
				$scale = pb_get_value_addon_real_value( $setting['scale'] );

				$transform = sprintf(
					'scale3d(%s, %s, 50%%)',
					$scale,
					$scale,
				);
				break;

			case 'rotate':
				$transform = sprintf(
					'rotateX(%s) rotateY(%s) rotateZ(%s)',
					pb_get_value_addon_real_value( $setting['rotate-x'] ),
					pb_get_value_addon_real_value( $setting['rotate-y'] ),
					pb_get_value_addon_real_value( $setting['rotate-z'] ),
				);
				break;

			case 'skew':
				$transform = sprintf(
					'skew(%s, %s)',
					pb_get_value_addon_real_value( $setting['skew-x'] ),
					pb_get_value_addon_real_value( $setting['skew-y'] ),
				);
				break;
		}

		if ( $transform ) {
			if ( ! empty( $this->properties['transform'] ) ) {
				$this->setProperty(
					'transform',
					sprintf(
						'%s %s',
						$this->properties['transform'],
						$transform
					)
				);
			} else {
				$this->setProperty( 'transform', $transform );
			}
		}
	}


